import {useState} from 'react';
import './style.css'

const Navbar = () => {
    let Links = [
        { name: 'Home', link: '/' },
        { name: 'About', link: '/' },
        { name: 'Contact', link: '/' },
        { name: 'Project', link: '/' },
        { name: 'Project', link: '/' }
    ]
    let [open , setOpen] = useState(false);
    return (
        <nav>
            <div className='md:flex items-center justify-between bg-color-primary py-5 md:px-10 px-8'>
                <div className='text-white text-xl flex items-center cursor-pointer'>
                    Yohanes.
                    <span>
                        Albert
                    </span>
                </div>
                <div onClick={()=>setOpen(!open)} className='text-3xl absolute right-8 top-6 cursor-pointer md:hidden'>
                    <ion-icon name={open  ? 'close':'menu'}></ion-icon>
                </div>
                <ul className='md:pb-0 pb-12 md:static md:z-auto z-[-1] left-0 w-full transition-all duration-300 ease-in md:hidden'>
                    {
                        Links.map((Link) => (  
                            <li key={Link.name} className='md:ml-8 md:my-0 my-7'>
                                <a href={Link.link} className='text-white hover:text-gray-600 duration-500 cursor-pointer'>{Link.name}</a>
                            </li>
                        ))
                    }
                </ul>
            </div>
        </nav>
    )
}

export default Navbar;
